import styled from 'styled-components'

const Wrapper = styled.div`
  clear: both;
  position: fixed;
  bottom: 0;
  height: 3.5rem;
  width: 100%;
  background: #202124;
  color: #6BA5ED;
  margin-top: -3.5rem;
`

const Content = styled.div`
  text-align: center;
`

// <h1>DO THE FIVE. <small>Help stop coronavirus</small></h1>

export default () => (
  <Wrapper>
    <Content>
      <h1>DO THE FIVE. <small>1. STAY home   2.KEEP distance   3. WASH hands often   4. COVER your cough   5. SICK? Call ahead!</small></h1>
    </Content>
  </Wrapper>
)
